webpackJsonp([0xfdc7263f8387],{981:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Perhaps not what you\'ve been waiting for all year — an extensive resource for researching various qualitative data analysis programs — but if you\'re in a research environment, this is actually extremely helpful. </p>\n<p>This page is from a university in the U.K., and would be useful if you\'re about to sink a few hundred dollars in some software (which will in turn play an important part in your research, of course.) </p>\n<p>Research it: <a title="CAQDAS (New Media Methods @ Loughborough University)" href="http://www.lboro.ac.uk/research/mmethods/research/software/caqdas_comparison.html">CAQDAS (New Media Methods @ Loughborough University)</a></p>',frontmatter:{created_at:"July 29, 2005",path:"/2005/07/29/qualitative-analysis-software-reviews",title:"Qualitative Analysis Software Reviews",tags:["qualitative","reserch"]}}},pathContext:{}}}});
